// Layuts

import LayoutAdmin from "../layouts/LayoutAdmin";
import LayoutBasic from "../layouts/LayoutBasic";

// Admin Pages
import AdminHome from '../pages/Admin';
import AdminSignIn from "../pages/Admin/Signin";

// User pages
import Home from "../pages/Home";
import Contact from "../pages/Contact" ;


// routes Admin
const routesAdmin = [
    {
        path: '/admin/*',
        layout: LayoutAdmin,
        component: AdminHome,
    },
    {
        path: '/admin/login',
        layout: LayoutAdmin,
        component: AdminSignIn ,
    }
];

// routes Client
const routesClient = [];

// routes User
const routesUser = [
    {
        path: '/',
        layout: LayoutBasic,
        component: Home,
    },
    {
        path: '/contact',
        layout: LayoutBasic,
        component: Contact,
    }
];

// routes total
const routes = [
  ...routesAdmin,
  ...routesUser,
  ...routesClient
];

export default routes;
